import React from "react";
import ReactDOM from "react-dom";

const name = "Saim Khan"
const crnDate = new Date().toLocaleDateString();
const crnTime = new Date().toLocaleTimeString();

ReactDOM.render(
  <>
 <h1>{`My Name Is ${name}`} </h1> 
 <p>this is crnDate {crnDate} </p>
 <p>this is crnTime {crnTime} </p>
  </>,

  document.getElementById("root")
)
